  false,\n\t\"url\": null,\n\t\"notes\": \"These profile data were collected from
  CDT casts aboard the Thomas G. Thompson in the Northeast Pacific as part of an effort
  to understand the cause of the near-bottom water column silica anomaly within Cascadia
  Basin. This data was used, along with historical casts, to constrain an inverse
  model of the bottom water circulation off the the coast of Washington, August 3
  - 16, 2006.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
